import React, {useEffect} from "react";
import {Table} from "antd";
import PubSub from 'pubsub-js'

function Contest() {
    const columns = [
        { title: '名字', dataIndex: 'name', key: 'name' },
        { title: '留言时间', dataIndex: 'time', key: 'time' },
        { title: '留言内容', dataIndex: 'content', key: 'content' },
    ];

    const data = [
        {
            key: 1,
            name: 'John Brown',
            time: '2021 17:28:46',
            content: 'New York No. 1 Lake Park',
        },
        {
            key: 2,
            name: 'Jim Green',
            time: '2021 17:28:46',
            content: 'London No. 1 Lake Park',
        },
        {
            key: 3,
            name: 'Not Expandable',
            time: '2021 17:28:46',
            content: 'Jiangsu No. 1 Lake Park',
        },{
            key: 4,
            name: 'Not Expandable',
            time: '2021 17:28:46',
            content: 'Jiangsu No. 1 Lake Park',
        },
    ];
    useEffect(()=>{
        console.log('生命周期钩子调用');
        PubSub.subscribe('table',(_,table_data)=>{
            console.log('本次打印为测试消息的订阅 从服务器接受结果渲染在contest的组件中',table_data);
            data.push(table_data);
            console.log('这是加入数据后的数组',data)

        })
    },[data])

    return(
        <div>
            <Table
                columns={columns}
                dataSource={data}
            />
        </div>
    )
}
export default Contest
